import React from "react";

const BooksFind = ({ title, publishedDate, bookID }) => {
  return (
    <div>
      <h1>{title}</h1>
      <p>{publishedDate}</p>
      <img
        alt={title}
        src={
          "http://books.google.com/books/content?id=" +
          { bookID } +
          "&printsec=frontcover&img=1&zoom=1&source=gbs_api"
        }
      />
    </div>
  );
};

export default BooksFind;
